import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { bindActionCreators } from 'redux';
import { connect } from 'react-redux';
import * as actions from './redux/actions';
import { Line, Column } from '@ant-design/charts';

export class TemplateChart extends Component {

  render() {
    let statistics = [];
    if(this.props.data){
      const data = this.props.data.log_statistics.log_template_mapping;
      Object.keys(data).forEach(temp=>{
        statistics.push({
          template:temp,
          value:data[temp],
        })
      })
    }

    const lineConfig = {
      data: statistics,
      height: 400,
      xField: 'template',
      yField: 'value',
      point: {
        size: 5,
        shape: 'diamond',
      },
    };

    const columnConfig = {
    data:statistics,
    xField: 'template',
    yField: 'value',
    label: {
      // 可手动配置 label 数据标签位置
      position: 'middle',
      // 'top', 'bottom', 'middle',
      // 配置样式
      style: {
        fill: '#FFFFFF',
        opacity: 0.6,
      },
    },
    xAxis: {
      label: {
        autoHide: true,
        autoRotate: false,
      },
    }}

    return (
     this.props.data?<Line {...(statistics.length > 20?lineConfig:columnConfig)} />:<div></div>
    );
  }
}

/* istanbul ignore next */
function mapStateToProps(state) {
  return {
    home: state.home,
  };
}

/* istanbul ignore next */
function mapDispatchToProps(dispatch) {
  return {
    actions: bindActionCreators({ ...actions }, dispatch)
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(TemplateChart);
